package Condidtional;

public class Switch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
              String name="naaraj";
              switch (name) {
			case "nagaraj":
			System.out.println("nagaraj");
				break;
			case "natraj":
			System.out.println("nagaraj");	
			default:
				System.out.println("ok");
				break;
			}
		
		
	}

}
